'use strict';
define(['app',
        '_s/utilService', '_s/benchmarkService',
        '_d/ngUpload','_d/cmThumb',
        '_v/image/resize'],
    function (app) {
    app.register.controller('ImageResizeCtrl',[
        '$scope',
        '$sce',
        'Util',
        'Benchmark',
        function($scope, $sce, Util, Benchmark){
            $scope.Object = Object;
            $scope.Util = Util;

            // drtv
            $scope.file = null
            $scope.thumb = null
            // ctrl
            $scope.resize = {
                proportinal: true,
                width: 90,
                height: 90,
                resampling: false,
                ratio: 0,
                lanczos: 3,
                quality: '1.0',
                mime: 'image/png'
            }
//            $scope.images = {
//                own:"data:image/jpg;base64,",
//                other:"data:image/jpg;base64,",
//                none:"data:image/jpg;base64,"
//            }

            $scope.reset = function(){
                $scope.thumb = {}
                $scope.original = {}
                $scope.resize.diff = ''
                $scope.resize.state = 'start resize'
                $scope.resize.timer = ''
            }

            $scope.reset()

            $scope.resizeFile = function(){
                if($scope.file.type.search('image/*') == -1) {
                    $scope.resize.state = '!!no image!! | choose image'
                    return false;
                }

                $scope.reset()

                Benchmark.start()
                // load file from uplaoder input
                var reader = new FileReader()
                ///////////////////////////////
                reader.onload = function(event){
                    // create image with image data#
                    var image = new Image()
                        image.src = event.target.result
                    // thumbnail image to canvas
                    ///////////////////////////////
                    image.onload = function(){
                        $scope.$apply(function(){
                            $scope.original = {width:image.width, height:image.height, size:$scope.file.size}
                            $scope.resize.state = 'thumbing...'
                        })

                        if(!$scope.resize.resampling) {
                            $scope.resizeThumb(event.target.result, $scope.file.size)
                            $scope.$apply();
                            return false;
                        } else {
                            var canvas = document.createElement("canvas")
                            new thumbnailer(canvas, image, $scope.resize.width, $scope.resize.lanczos, function () {
                                $scope.$apply(function () {
                                    $scope.thumb.src = canvas.toDataURL($scope.resize.mime, $scope.resize.quality)

                                    var thumb = new FileReader()
                                    thumb.onload = function(event){
                                        $scope.thumb.size = event.total
                                        $scope.$apply()
                                    }
                                    thumb.readAsDataURL(b64toBlob($scope.thumb.src.replace(new RegExp('^(data:(.*);base64,)','i'),'')))

                                    $scope.resize.state = 'done! | start resize'
                                    $scope.resize.timer = Benchmark.end()
                                })
                            })
                        }
                    }
                    ///////////////////////////////
                }
                ///////////////////////////////
                reader.readAsDataURL($scope.file)
                $scope.resize.state = 'loading...'
            }

            $scope.resizeThumb = function(base64, bytes){
                if(base64 == undefined){
                    $scope.reset()
                    return false
                }

                thumbnail(base64, $scope.resize.width, $scope.resize.height, function(canvas){
                    $scope.thumb.src = canvas.toDataURL($scope.resize.mime, $scope.resize.quality)

                    var thumb = new FileReader()
                    thumb.onload = function(event){
                        $scope.thumb.size = event.total
                        $scope.$apply()
                    }
                    thumb.readAsDataURL(b64toBlob($scope.thumb.src.replace(new RegExp('^(data:(.*);base64,)','i'),'')))

                    $scope.resize.state = 'done! | start resize'

                    $scope.resize.timer = Benchmark.end()
                })

            }

            $scope.checkProportions = function(side){
                if(!$scope.resize.proportinal)
                    return false
                if(side == 'width')
                    $scope.resize.height = $scope.resize.width
                else if(side == 'height')
                    $scope.resize.width = $scope.resize.height
            }

            $scope.setDimTo = function(size){
                $scope.resize.width = size
                $scope.resize.height = size
            }
        }
    ])
})